import React from "react";
import * as S from "./main_s"


function Main() {
    return (
      <div className="main">
       <S.headBlock className="headBlock"/> 
        <S.text className="text">Находите места для жизни
и работы по всему миру</S.text>
        <S.button className="button">Подобрать недвижимость</S.button>

       <div className="centerBlock" ></div>
      </div>
    );
  }


export default Main;
